function toRawFeature(element) {
    var feature = {};
    feature.id = element.id;
    feature.type = element.type;
    feature.properties = element.tags;

    if(element.type == "node") {
        feature.coords = getNodePoint(element.id);
    }
    else if(element.type == "way") {
        feature.coords = getNodePointList(element.nodes);
    }
   else {
        //shouldn't happen
        throw new Error("Unexpected osm type: " + element.type);
    }

    return feature;
}

function getNodePointList(nodeIdList) {
    return nodeIdList.map((id) => getNodePoint(id));
}

