updateData.supplementalCode:
function createFeature(rawFeature) {
    var feature = {};
    feature.type = "Feature";
    feature.properties = rawFeature.properties;
    feature.geometry = getGeometry(rawFeature);
    return feature;
}

function getGeometry(rawFeature) {
    var coords;
    var type;
    switch(rawFeature.type) {
        case "node":
            type = "Point";
            coords = getGeojsonPoint(rawFeature.coords);
            break;

        case "way":
            if(theme.isPolygon(rawFeature)) {
                type = "Polygon";
                coords = getGeojsonPolygon(rawFeature.coords);    
            }
            else {
                type = "LineString";
                coords = getGeojsonLineString(rawFeature.coords);
            }
            break;

        default:
            throw new Error("Unexpected osm type!");
    }

    return {
        "type": type,
        "coordinates": coords
    }
}

function getGeojsonPoint(coords) {
    return coords;
}

function getGeojsonLineString(coords) {
    return coords;
}

function getGeojsonPolygon(coords) {
    return [getGeojsonLineString(coords)];
}

